        justify="center"
        alignItems="center" spacing={2}>
        <Grid item xs={11} lg={8} md={10} sm={10}>

          <Typography variant="h5" gutterBottom>
          <Box mt={5}>
          I am self-taught JavaScript developer/ Blockchain enthusiastic.I am currently sharping my skillS working with MERN stack.Ever since I have started to program my goal has been to improve my programming knowledge ,for example, to have a stronger basic fundamental with JavaScript,Debugging ,testing and Database in order to improve efficiency in my algorithms. <FcCommandLine size="2rem" /> 
        </Box> 
        </Typography>
        </Grid>
     </Grid>
     </div>
    )}

export default React.memo(About)
